import React, { Component } from "react";
import "../styles/timeline.css";

class ToyRowCard extends Component {
  render() {
    const { cardClass } = this.props.toyRowCard;
    return (
      <div className={cardClass}>
        {/* <ToyImage currentToyImage={currentToyImage} /> */}
        <h3>{this.props.toyRowCard.title}</h3>
        <p>{this.props.description}</p>
      </div>
    );
  }
}

export default ToyRowCard;
